import React from "react";
import { useSelector } from "react-redux";

const DiaryList = () => {
    const dairyList = useSelector((it) => it.write.writeList);
    return (
        <div>
            {dairyList.map((it) => (
                <div key={it.id}>{it.content}</div>
            ))}
        </div>
    );
};

export default DiaryList;
